// ================================================
//   Controlador de Reportes
// ================================================
angular.module('reportModule').controller('reportCtrl', ['$scope','reportService', function($scope,reportService){

	$scope.activar('mReport','','Reporte','todos los Reportes');
	$scope.report = {};
	$scope.reports = {};
	/**** Función date pickter range ****/
	$(function() {
		moment.locale('es-do'); // 'en'
		$('input[name="datefilter"]').daterangepicker({
		  autoUpdateInput: false,
		  locale: {
		      cancelLabel: 'Clear'
		  }
		});

		$('input[name="datefilter"]').on('apply.daterangepicker', function(ev, picker) {
			$(this).val(picker.startDate.format('D MMMM YYYY') + ' - ' + picker.endDate.format('D MMMM YYYY'));
			$scope.report.startDate = picker.startDate.format('YYYY-MM-DD');
			$scope.report.endDate = picker.endDate.format('YYYY-MM-DD');
			reportService.cargarReport($scope.report).then( function(response){
				$scope.reports = response;
				console.log($scope.reports);

				/**** Función jsPDF ****/
				var configPDF = {
				    title: 'Reporte de los pedidos',
				    subject: 'Reporte de pedidos por rango de fechas',
				    author: 'IMBA',
				    keywords: 'imba, pollos, carne',
				    creator: 'Grober Aguilar'
				};
				var linea = 20;
				function header(doc) {
					/////// Recuadro del encabezado ///////
					doc.setLineWidth(1);
					doc.setDrawColor(80,90,215);
					doc.setFillColor(120,150,250);
					doc.rect(10, 10, 270, 32, 'FD'); 

					/////// Recuadro del logo izquierda ///////
					doc.setLineWidth(0);
					doc.setDrawColor(255);
					doc.setFillColor(250,250,250);
					doc.rect(14, 13, 29, 25, 'FD');

					//Convertir IMG a Base64 https://www.base64-image.de/
					var img = new Image();
					img.src = 'data:image/jpeg;base64,';
					doc.addImage(img,'JPEG',18, 15, 21, 15, undefined,'slow');

					/////// Recuadro del logo derecha ///////
					doc.setLineWidth(0);
					doc.setDrawColor(255);
					doc.setFillColor(250,250,250);
					doc.rect(245, 13, 29, 25, 'FD');

					var img2 = new Image();
					img2.src = "data:image/png;base64,";
					doc.addImage(img2,'JPEG',247, 14, 25, 23, undefined,'slow');

					/////// Descripción del logo de la izquierda ///////
					doc.setFont("helvetica");
					doc.setFontType("bold");
					doc.setFontSize(12);
					doc.text(18,linea+16,'IMBA S.A.');

					/////// Título del Reporte ///////
					doc.setFontSize(18);
					doc.text(147, linea-3, 'INDUSTRIA MOLINERA DE ALIMENTOS BALANCEADOS', null, null, 'center');

					/////// Datos de IMBA encabezado ///////
					doc.setFont("courier");
					doc.setFontSize(12);
					doc.text(50,linea=linea+5,'Cll: Ayacucho N° 254 Zona Central');
					doc.text(50,linea=linea+5,'Teléfono: 64-35323');
					doc.text(50,linea=linea+5,'Sucre-Chuquisaca-Bolivia');

					/////// Subtítulo REPORTE ///////
					doc.setFont("helvetica");
					doc.setFontType("bold");
					doc.setFontSize(22);
					doc.text(195, linea-4, 'REPORTE');
				};
				function content(doc) {
					/////// Recuadro BODY ///////
					doc.setLineWidth(0.5);
					doc.setDrawColor(150,150,150);
					doc.setFillColor(250,250,250);
					doc.rect(10, linea=linea+15, 270, 145, 'FD');
					/////// Descripcíon BODY ///////
					doc.setFont("courier");
					doc.setFontType("bold");
					doc.setFontSize(14);
					doc.text(147,linea=linea+5,'DATOS DE LOS PEDIDOS', null, null, 'center');
				};
				function contentPage(doc) {
					/////// Recuadro BODY ///////
					doc.setLineWidth(0.5);
					doc.setDrawColor(150,150,150);
					doc.setFillColor(250,250,250);
					doc.rect(10, linea=linea+15, 270, 180, 'FD');
					/////// Descripcíon BODY ///////
					doc.setFont("courier");
					doc.setFontType("bold");
					doc.setFontSize(14);
					doc.text(147,linea=linea+5,'DATOS DE LOS PEDIDOS', null, null, 'center');
				};
				function pedido(doc,h_inicio,h_final,obj_pedido) {
					/////// Recuadro Datos del pedido ///////
					doc.setLineWidth(0.5);	
					doc.setDrawColor(150,150,150);
					doc.setFillColor(253,253,253);
					doc.rect(20, h_inicio=h_inicio+5, 250, h_final, 'FD');
					/////// Líneas del recuadro horizontales ///////
					doc.setLineWidth(0.5);
					doc.line(20, h_inicio+10, 270, h_inicio+10);
					doc.line(20, h_inicio+20, 270, h_inicio+20);
					/////// Líneas del recuadro verticales ///////
					doc.line(45, h_inicio+20, 45, h_inicio+h_final);
					doc.line(120, h_inicio+20, 120, h_inicio+h_final);
					doc.line(145, h_inicio+20, 145, h_inicio+h_final);
					doc.line(170, h_inicio+20, 170, h_inicio+h_final);
					doc.line(195, h_inicio+20, 195, h_inicio+h_final);
					doc.line(220, h_inicio+20, 220, h_inicio+h_final);

					/////// Datos de cada pedido ///////
					doc.setFontSize(12);
					doc.setFont("times");
					doc.setFontType("bold");
					doc.text(23,h_inicio=h_inicio+6,'Código del pedido: #');
					doc.setFontType("");
					doc.text(61,h_inicio,obj_pedido.id);
					doc.setFontType("bold");
					doc.text(140,h_inicio,'Fecha del pedido: ');
					doc.setFontType("");
					doc.text(175,h_inicio,obj_pedido.fec);
					doc.setFontType("bold");
					doc.text(200,h_inicio,'Fecha de entrega: ');
					doc.setFontType("");
					doc.text(235,h_inicio,obj_pedido.fec_up);

					doc.setFontType("bold");
					doc.text(23,h_inicio=h_inicio+10,'Código');
					doc.text(45,h_inicio,'Producto');
					doc.text(120,h_inicio,'Precio');
					doc.text(145,h_inicio,'Cantidad C.');
					doc.text(170,h_inicio,'Unidad C.');
					doc.text(195,h_inicio,'Precio C.');
					doc.setFontSize(10);
					doc.text(222,h_inicio+10,'TOTAL PEDIDO: '+obj_pedido.sale);

					h_inicio += 5; 
					obj_pedido.products.forEach(function(element,index,array) {
						doc.setFontType("");
						doc.text(24,h_inicio=h_inicio+5,element.cod);
						doc.text(46,h_inicio,element.name);
						doc.text(121,h_inicio,element.price_product);
						doc.text(146,h_inicio,element.quantity);
						doc.text(171,h_inicio,element.unity);
						doc.text(196,h_inicio,element.price_contains);
					});
				};

				function crearPDF(obj) {
					var doc = new jsPDF('landscape');
					doc.setProperties(obj);
					header(doc);
					content(doc);
					//inicio->55 empiezan los productos
					//final->30 para un producto
					var inicio = 55;
					var final = 30;
					var cant = 0;
					var maxP = 0;
					$scope.reports.forEach(function(element,index,array) {
						maxP = inicio+final+35+(cant*4);
						console.log(maxP);
						if(maxP > 240) {
							inicio = 20;
							linea = 0;
							final = 30;
							maxP = 0;
							doc.addPage();
							contentPage(doc);
						}
						cant = element.products.length;
						final = 30 + (cant*4);
						pedido(doc,inicio,final,$scope.reports[index]);
						inicio += 35+(cant*4);
					});
					doc.save('Test.pdf');
				};

				crearPDF(configPDF);



















			});

		});

		$('input[name="datefilter"]').on('cancel.daterangepicker', function(ev, picker) {
			$(this).val('');
		});
	});

}]);
